Subroutine CouplingAhSdcUSdL(gt1,gt2,gt3,Mu,Yd,Td,ZD,ZA,res)

Implicit None 

Integer, Intent(in) :: gt1,gt2,gt3
Real(dp), Intent(in) :: ZA(2,2)

Complex(dp), Intent(in) :: Mu,Yd(3,3),Td(3,3),ZD(6,6)

Complex(dp), Intent(out) :: res 
 
Integer :: j1,j2,j3,j4,j5,j6, j7, j8, j9, j10, j11, j12 
Iname = Iname +1 
NameOfUnit(Iname) = 'CouplingAhSdcUSd' 
 
If ((gt1.Lt.1).Or.(gt1.Gt.2)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt1 out of range', gt1 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt1 out of range', gt1 
  Call TerminateProgram 
End If 

If ((gt2.Lt.1).Or.(gt2.Gt.6)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt2 out of range', gt2 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt2 out of range', gt2 
  Call TerminateProgram 
End If 

If ((gt3.Lt.1).Or.(gt3.Gt.6)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt3 out of range', gt3 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt3 out of range', gt3 
  Call TerminateProgram 
End If 

res = 0._dp 
If ((gt3.le.3).And.(gt3.ge.1)) Then 
Do j1 = 1,3
res = res-((Conjg(ZD(gt2,3 + j1))*Conjg(Td(j1,gt3))*ZA(gt1,1))/sqrt(2._dp))
End Do 
End If 
If ((gt3.le.3).And.(gt3.ge.1)) Then 
Do j1 = 1,3
res = res-((Mu*Conjg(Yd(j1,gt3))*Conjg(ZD(gt2,3 + j1))*ZA(gt1,2))/sqrt(2._dp))
End Do 
End If 
If ((-3 + gt3.le.3).And.(-3 + gt3.ge.1)) Then 
Do j2 = 1,3
res = res+(Conjg(Mu)*Conjg(ZD(gt2,j2))*Yd(-3 + gt3,j2)*ZA(gt1,2))/sqrt(2._dp)
End Do 
End If 
If ((-3 + gt3.le.3).And.(-3 + gt3.ge.1)) Then 
Do j2 = 1,3
res = res+(Conjg(ZD(gt2,j2))*ZA(gt1,1)*Td(-3 + gt3,j2))/sqrt(2._dp)
End Do 
End If 
res = (0.,1.)*res 
 
If (Real(res,dp).ne.Real(res,dp)) Then 
 Write(*,*) "NaN appearing in ",NameOfUnit(Iname) 
 Call TerminateProgram 
End If 


Iname = Iname - 1 
 
End Subroutine CouplingAhSdcUSdL  
 
 
Subroutine CouplingChaFucUSdL(gt1,gt2,gt3,g2,Yd,Yu,UM,UP,ZUL,ZUR,resL,resR)

