If ((gt3.Lt.1).Or.(gt3.Gt.6)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt3 out of range', gt3 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt3 out of range', gt3 
  Call TerminateProgram 
End If 

resL = 0._dp 
If ((-3 + gt3.le.3).And.(-3 + gt3.ge.1)) Then 
Do j2 = 1,3
resL = resL-(Conjg(ZDL(gt2,j2))*Conjg(ZN(gt1,3))*Yd(-3 + gt3,j2))
End Do 
End If 
If ((gt3.le.3).And.(gt3.ge.1)) Then 
resL = resL-(g1*Conjg(ZDL(gt2,gt3))*Conjg(ZN(gt1,1)))/(3._dp*sqrt(2._dp))
End If 
If ((gt3.le.3).And.(gt3.ge.1)) Then 
resL = resL+(g2*Conjg(ZDL(gt2,gt3))*Conjg(ZN(gt1,2)))/sqrt(2._dp)
End If 
resR = 0._dp 
If ((gt3.le.3).And.(gt3.ge.1)) Then 
Do j1 = 1,3
resR = resR-(Conjg(Yd(j1,gt3))*ZDR(gt2,j1)*ZN(gt1,3))
End Do 
End If 
If ((-3 + gt3.le.3).And.(-3 + gt3.ge.1)) Then 
resR = resR-(sqrt(2._dp)*g1*ZDR(gt2,-3 + gt3)*ZN(gt1,1))/3._dp
End If 
If ((Real(resL,dp).ne.Real(resL,dp)).or.(Real(resR,dp).ne.Real(resR,dp))) Then 
 Write(*,*) "NaN appearing in ",NameOfUnit(Iname) 
 Call TerminateProgram 
End If 


